import { Card, Button } from "react-bootstrap";
import { useHistory, useParams } from "react-router-dom";
import { SiteContext } from "../../context";
import { ICompanyData } from "../../types";

interface CompanyCardProps {
  companyInfo: ICompanyData[]
// text-danger , text-success 
}




const compareInputsAndReturnStatus = (input1:number,input2:number):string=>{
    if( input1 > input2){
        return "text-success";
    }
    
    if(input1 == input2){
      return "";

    }else{
      return "text-danger";
    }

    return "";

}

const compareInit = (companyInfo:ICompanyData[],field : string):string=>{
  type ObjectKey1 = keyof typeof companyInfo1; 
  type ObjectKey2 = keyof typeof companyInfo2;
  let companyInfo1:ICompanyData = companyInfo[0];
  let companyInfo2:ICompanyData = companyInfo[1];
  let field1 = field as ObjectKey1;
  let field2 = field as ObjectKey2;
  let wait:string ; 

if(typeof companyInfo1[field1]  != undefined && typeof companyInfo2[field2]  != undefined ){
  let input1 = companyInfo1[field1] ?? 0 ;
  let input2 = companyInfo2[field2] ?? 0 ;
  console.log(input2,input1)

  switch(field){
    case "companyProfit":
      return compareInputsAndReturnStatus(+input1, +input2)  ;
    break
    case "debt":
      return compareInputsAndReturnStatus(+input1, +input2)  ;
    break
    case "equitity":
      return compareInputsAndReturnStatus(+input1, +input2)  ;
    break
    case "depositDate":
      return compareInputsAndReturnStatus(+input1, +input2)  ;
    break
    default :

      return "black"
    break

  }
  console.log(companyInfo[0].companyProfit > companyInfo[1].companyProfit)

}

}



const CompanyCard = ({ companyInfo }: CompanyCardProps) => {
  if(companyInfo.length > 0){
  compare(companyInfo,"companyProfit");
}
  return (
      
      <>
      { companyInfo?.map((c: ICompanyData,i:number) => {
            return (
              <div className="col-md-3  mt-5 ml-5">
              <Card style={{ width: '100%',minHeight:"400px" }}>
                <Card.Body>
                  <Card.Title>{c.name}</Card.Title>
                  <Card.Text>VAT : {c.vat} </Card.Text>
                  <Card.Text>Adress: {c.address}</Card.Text>
                  <Card.Text>Publishing Date: {c.depositDate}</Card.Text>
                  <Card.Text>Equity: {c.equitity}</Card.Text>
                  <Card.Text>Debts: {c.debt}</Card.Text>
                  <Card.Text>Profit: {c.companyProfit}</Card.Text>
                </Card.Body>
              </Card>
              </div>
            )
          }
          )
      }
 
 </>

  )
}

export default CompanyCard;
